import {isWhiteSpaces} from "eslint-plugin-react/lib/util/jsx";

const NavbarStyle = {
    container: {
        //transparent background with no border
        backgroundColor: "transparent",
        border: "none",
        //positioned at the top of the page
        position: "fixed",
        top: "0",
        //full width
        width: "100%",
        //no padding, no margin
        padding: "0",
        margin: "0",
        //no shadow
        boxShadow: "none",
        //no z-index
        zIndex: "0",
        //row
        display: "flex",
        flexDirection: "row",
    },
    textTitle: {
        //white text
        color: "white",
        //centered text
        textAlign: "center",
        //bold text
        fontWeight: "bold",
	    //text font roboto
        fontFamily: "Roboto",
        //font size 30px
        fontSize: "2vh",
        //content is centered
        justifyContent: "center",
        //position handling
        marginLeft: "15vw",
        marginTop: "5vh",
    },
    textSubtitle: {
        //white text
        color: "white",
        //centered text
        textAlign: "center",
        //no margin
        margin: "0",
        //no padding
        padding: "0",
        //bold text
        fontWeight: "bold",
        //text font roboto
        fontFamily: "Roboto",
        //font size 20px
        fontSize: "20px",
        //content is centered
        justifyContent: "center",
        //position handling
        marginLeft: "5vw",
        marginTop: "5.5vh",
    },
    searchContainer: {
        backgroundColor: "rgba(255, 255, 255, 0.2)",
        border: "white solid 1px",
        borderRadius: "100%",
        //centered text
        textAlign: "center",
        //no margin
        margin: "0",
        //no padding
        padding: "0",
        
        //content is centered
        justifyContent: "center",
        //position handling
        marginLeft: "auto",
        marginRight: "25vh",
        marginTop: "5.5vh",
    },
    searchIcon: {
        color: "white",
        //centered text
        textAlign: "center",
        //no margin
        margin: "0",
        //no padding
        padding: "0",
        //bold text
        fontWeight: "bold",
        //text font roboto
        fontFamily: "Roboto",
        //font size 20px
        fontSize: "20px",
        //content is centered
        justifyContent: "center",
    }
};

export default NavbarStyle;
